import React, { useEffect, useState } from 'react';

function Main(){

    return(
        <div className="Main">
            <div className="container justify-content-center">
                <div className="form-group mt-5 mb-5">
                    <label for="searchCountry" style={{color: 'white'}}>Search By Country</label>
                    <input id="searchCountry" className="form-control" type="text"></input>
                </div>

                <div className="form-group mt-5 mb-5">
                    <label for="searchCountry" style={{color: 'white'}}>Search By State/Province/Region</label>
                    <input id="searchCountry" className="form-control" type="text"></input>
                </div>

                <div className="form-group mt-5 mb-5">
                    <label for="searchCountry" style={{color: 'white'}}>Search By City/Region</label>
                    <input id="searchCountry" className="form-control" type="text"></input>
                </div>
            </div>
        </div>
    )
};

export default Main;
